import {Link, useNavigate} from 'react-router-dom'
import { useState } from 'react'
import validation from './registervalidation'
import axios from 'axios'
function Register(){
       const[values, setValues] = useState({
                    name:" ",
                    age:" ",
                    batch_time:" ",
                    email: '',
                    password:''
       })
       const navigate= useNavigate()
       const [errors, setErrors]= useState({})
       const handleInput= (event)=>{
                    setValues(prev => ({...prev, [event.target.name]: [event.target.value]}))
       }
       const handleSubmit =  (event)=>{
                    event.preventDefault();
                    setErrors(validation(values));
                    if (errors.name === "" && errors.email==="" && errors.password===""){
                        // calling api
                             axios.post('http://localhost:8081/Register', values).then(res=>{ navigate('/');}).catch(err=>console.log(err));
                    }
       }                    
       return(
            <div className = 'd-flex justify-content-center align-items-center bg-primary vh-100'>
              <div className='bg-white p-3 rounded w-25'>
                    <h2>Register Page</h2>
                   <form action="" onSubmit={handleSubmit}>

                   <div className = 'mb-3'>
                            <label htmlFor = "name"><strong>Name</strong></label>
                            <input type ="name" placeholder = "Enter Name" name = 'name' onChange={handleInput}  className="form-control rounded-0"/>
                            {errors.name && <span className='text-danger'>{errors.name}</span>}
                        </div>
                        <div className = 'mb-3'>
                            <label htmlFor = "email"><strong>Email</strong></label>
                            <input type ="email" placeholder = "Enter Email" name='email'  onChange={handleInput}  className="form-control rounded-0"/>
                            {errors.email && <span className='text-danger'>{errors.email}</span>}
                        </div>
                        <div className = 'mb-3'>
                            <label htmlFor = "age"><strong>Age</strong></label>
                            <input type ="age" placeholder = "Enter Age" name='age' className="form-control rounded-0"/>
                        </div>
                        <div className = 'mb-3'>
                            <label htmlFor = "batch_time"><strong>Batch Time</strong></label>
                            <select id="batch_time" name="batch_time" required>
                                     <option value="6-7AM">6-7AM</option>
                                     <option value="7-8AM">7-8AM</option>
                                     <option value="8-9AM">8-9AM</option>
                                     <option value="5-6PM">5-6PM</option>
                                 </select>
                            </div>
                        <div className = 'mb-3'>
                        <label htmlFor = "password"><strong>password</strong></label>
                        <input type ="password" placeholder = "Enter Password" name='password' onChange={handleInput}  className="form-control rounded-0" />
                        {errors.password && <span className='text-danger'>{errors.password}</span>}
                    </div>
                    <button type='submit' className='btn btn-success w-100'>SignIN</button>
                    <p>Your are agree to out terms and conditions</p>
                    <Link to='/' className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none'>LogIn</Link>


                   </form>
            
               </div>
            
            </div>        
       )

}

export default Register
